import React from 'react';
import { Link } from 'react-router-dom'
import profPic from './pic.jpg';

const navList = () => {
    return(
        <div lassName="project-list section listBlock">
        <image alt="profile picture" src={profPic}></image>
        <Link to="/">
             <button className="buttonList">פרטים אישיים</button>
        </Link>
        <Link to="/">
             <button className="buttonList">מצב משפחתי</button>
        </Link>
        <Link to="/">
             <button className="buttonList">מצב אקדמי</button>
        </Link>
        <Link to="/">
             <button className="buttonList">מעקב שבועי</button>
        </Link>
    </div>
    )
}

export default navList;
